/*
 User API 예시
 */
import axios, { AxiosResponse } from "axios";
interface requestLoginData {
  email: string;
  password: string;
}
const requestLogin = (
  data: requestLoginData,
  callback: (response: AxiosResponse<any>) => boolean,
  errorCallback: () => void
) => {
  //백앤드와 로그인 통신하는 부분
  let url = "http://" + "localhost:8080" + "/account/login";
  axios
    .post(url, data)
    .then(response => {
      callback(response);
      console.log(response);
    })
    .catch(() => {
      errorCallback();
    });
};

const UserApi = {
  requestLogin: (
    data: requestLoginData,
    callback: () => void,
    errorCallback: () => void
  ) => requestLogin(data, callback, errorCallback)
};

export default UserApi;
